import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <div className="navbar">
          <div className="nav-left">
            <label>REHAT</label>
          </div>
          <div className="nav-right">
            <label>Layanan kami</label>
            <label>Tentang</label>
            <label>Kontak</label>
          </div>
        </div>
      </div>
      <div className="body"></div>
      <div className="footer"></div>
    </div>
  );
}

export default App;
